import { Button } from "@mui/material";
import { useNavigate } from "react-router";

const Footer = () => {
    const history = useNavigate();
    const handleCreateClick = () =>{
        history("/create");
    };
    return (
      <div
        style={{
          textAlign: "center",
          marginBottom: 10,
        }}
      >
          <Button
            variant="contained"
            color="primary"
            size="large"
          >
            Login
          </Button>
      </div>
    );
  };

  export default Footer;
